function removeHashes(string = "") {
  return string.replaceAll("#", "");
}

/**
 * Icon component for rendering SVG icons.
 *
 * @component
 * @example
 * // Example usage of Icon component
 * <Icon id="svg-icon-id" width={30} className="text-primary" />
 *
 * @param {Object} props - The component props.
 * @param {string} [props.id=""] - The ID of the SVG icon.
 * @param {number} [props.width=30] - The width of the SVG icon.
 * @param {number|null} [props.height=null] - The height of the SVG icon. Defaults to the width if not provided.
 * @param {string} [props.fill="currentColor"] - The fill color of the SVG icon.
 * @param {string} [props.className=""] - Additional CSS classes for the SVG icon.
 * @param {*} [props.debugData=null] - Debug data to log.
 * @returns {JSX.Element | null} The rendered Icon component or null if no ID is provided.
 */
export function Icon({
  id = "",
  width = 30,
  height = 30,
  fill = "currentColor",
  className = "",
  debugData = null,
  ...rest
}) {
  if (id) {
    return (
      <svg
        width={width}
        height={height ?? width}
        fill={fill}
        className={className}
        {...rest}
      >
        <use href={`#${removeHashes(id)}`}></use>
      </svg>
    );
  }

  if (debugData) {
    console.log(debugData);
  }

  return null;
}

